from typing import List
from math import sqrt

class Solution:
    def maximumScore(self, nums: List[int], k: int) -> int:
        def prime_factors_count(x):
            count = 0
            if x % 2 == 0:
                count += 1
                while x % 2 == 0:
                    x //= 2
            for i in range(3, int(sqrt(x)) + 1, 2):
                if x % i == 0:
                    count += 1
                    while x % i == 0:
                        x //= i
            if x > 2:
                count += 1
            return count

        nums_prime_scores = [(prime_factors_count(x), x) for x in nums]
        nums_prime_scores.sort(reverse=True)

        score = 1
        mod = 10**9 + 7
        for _, val in nums_prime_scores[:k]:
            score = (score * val) % mod

        return score
